import logo from './logo.svg';
import './App.css';
import Header from './Header.js';
import Map from'./Map.js';
import Vehicles from'./Vehicles.js';


function App() {
    <Router>
        <Routes>
            <Route exact path="/" element={<Home />} />
            <Route path="/about" element={<About />} />
            <Route
                path="/contact"
                element={<Contact />}
            />
            <Route path="/blogs" element={<Blogs />} />
            <Route
                path="/sign-up"
                element={<SignUp />}
            />
        </Routes>
    </Router>
  return (
    <div id="body">
      <Header />
      <Map />
    </div>
  );
}

export default App;
